import React from "react";
import styled from "styled-components";
import Navbar from "./Navbar";
import Illustration from "./Illustration";
import Parallex from "react-rellax";


const Container = styled.div`
  width: 100%;
  height: 100vh;
  display: flex;
  background-image: linear-gradient(to bottom, #131424, #343b7c);
  overflow: hidden;
`;

const Left = styled.div`
  flex: 1;
  position: relative;
`;
const Info = styled.div`
  position: absolute;
  top: 20%;
`;

const Title = styled.h1`
  font-size: 76px;
  margin: 0 0 0 70px;
  color: white;
`;
const Subtitles = styled.h2`
  margin: 0 0 0 70px;
  font-weight: lighter;
  opacity: 0.5;
  font-style: italic;
  color: gray;
`;
const Desc = styled.p`
  margin: 30px 0 0 70px;
  width: 75%;
  color: white;
`;
const Right = styled.div`
  flex: 1;
`;

const List = styled.li`
    font-size: 36px ;
    display: flex ;
`

const Home = () => {
  return (
    <>
      <Navbar />
      <Container>
        <Left>
          <Info>
            <Parallex speed={5}>
              <Title>Cipher Club</Title>
            </Parallex>
            <Parallex speed={4}>
              <Subtitles>
                <List>Web Developer</List>
                <List>Game Developer</List>
                <List>UI/UX Designer</List>
                <List>Writer</List>
                <List>Data Analyist</List>
              </Subtitles>
            </Parallex>
            <Parallex speed={3}>
              <Desc>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Placeat
                qui exercitationem delectus. Lorem ipsum dolor sit amet
                consectetur adipisicing elit. Placeat qui exercitationem
                delectus. Lorem ipsum dolor sit amet consectetur adipisicing
                elit. Placeat qui exercitationem delectus. Lorem ipsum dolor sit
                amet consectetur adipisicing elit. Placeat qui exercitationem
                delectus.
              </Desc>
            </Parallex>
          </Info>
        </Left>
        <Right>
          {/* <Parallex speed={-10}> */}
         <Illustration/>
         {/* </Parallex> */}
        </Right>
      </Container>
      
    </>
  );
};

export default Home;
